import React,{Component} from 'react';
import {Container,Row,Col,Card,Button} from 'react-bootstrap'
import {data} from '../dummydb';

class mycart extends Component{

    render(){
        return(
            <Container style={{paddingTop:40,maxWidth:1024}}>

                <Card className="m-b-20">

                    <Card.Body>
                        <Row>
                        <Col md={3}>
                            <img alt='datacart' width={"100%"} height={200} src={data[3].image_url} />
                        </Col>
                        <Col md={9}>
                            <h3>{data[3].name}</h3>
                            <p>Rp. {data[3].price}</p>
                            <p>Jumlah</p>
                            <Button variant="danger"><i className="fa fa-minus"></i></Button>
                                <input value="1" type="text" className="input-cart-amount"></input>
                            <Button><i className="fa fa-plus"></i></Button>
                        </Col>
                    </Row>
                    </Card.Body>
                </Card>
                <Card>
                    <Card.Body>Total Belanja : </Card.Body>
                </Card>

            </Container>
        );
    }
}

export default mycart;
